import React from 'react';
import ReactDOM from 'react-dom';
// import App from './App';
import ex_baner from './extraction.jpg';
import safe from './safe.jpg';
import dark from './dark.jpg';
import Cards from './Cards';
ReactDOM.render(<>    <h2>TOP 6 NETFLIX SERIES</h2>
        <Cards imgsrc= {ex_baner} title="A netflix orignal series."
                      seriesname="EXTENTION" 
                       watch_btn_link="https://www.netflix.com/in/title/80230399"/>
                    <br></br>

                   <Cards imgsrc= {safe} title="A netflix orignal series."
                      seriesname="SAFE" 
                       watch_btn_link="https://www.netflix.com/in/title/80201500"/>

                    <Cards imgsrc= {dark} title="A netflix orignal series."
                      seriesname="DARK" 
                       watch_btn_link="https://www.netflix.com/in/title/80100172"/>                       
                       </>,document.getElementById('root'));
